import React from 'react';
import { AppBar, Box, CssBaseline, Toolbar, Typography } from '@material-ui/core';

const Header = () =>{
    return(
        <>
            <CssBaseline/>
            <AppBar positon="fixed" color="#fff">
                <Toolbar>
                    <Typography variant="h6">
                        HCA Healthcare Video Library
                    </Typography>
                </Toolbar>
            </AppBar>
        </>
    );

}
export default Header;
